import React from "react";

const Benefit = () => {
  return (
    <div
      style={{
        marginLeft: "20px",
        border: "3px solid black",
        width: "670px",
        height: "120px",
      }}
    >
      <p
        style={{ marginLeft: "10px", fontWeight: "bold", marginBottom: "5px" }}
      >
        Yang anda dapatkan di pelatihan ini :
      </p>
      <ul
        style={{
          display: "flex",
          flexWrap: "wrap" /* Wrap jika tidak cukup ruang */,
          justifyContent: "flex-end" /* Tengahkan horizontal */,
          backgroundColor: "blue",
          padding: 0,
          margin: 0,
        }}
      >
        <li style={{ width: "50%", marginLeft: "10px" }}>
          4 menit total video pembelajaran
        </li>
        <li style={{ width: "50%", marginLeft: "10px" }}>5 bahan bacaan</li>
        <li style={{ width: "50%", marginLeft: "10px" }}>
          5 konten dapat di unduh
        </li>
        <li style={{ width: "50%", marginLeft: "10px" }}>5 bahan bacaan</li>
        <li style={{ width: "50%", marginLeft: "10px" }}>
          5 konten dapat di unduh
        </li>
      </ul>
    </div>
  );
};

export default Benefit;
